$(window).on("load", function() {

    //1. 페이지 도착 #62575 -2023.09.26.
    //공통태깅 중복으로 삭제 #62575 -2023.09.27.
    /*
    window.dataLayer.push({
        'event': 'page_view',
        'page_type': 'ev day'
    });
    console.log('1. 페이지 도착');
    console.log(window.dataLayer);
    */


    //5. 캠페인 머문시간. 20초 
    setTimeout(function () {
        window.dataLayer.push({
            'event': 'campaign',
            'event_category': 'campaign page sections',
            'event_action': 'campaign experience',
            'event_label': '20sec duration',
            'page_type': 'ev day'
        });
        console.log('5. 캠페인 머문시간. 20초 ');
        console.log(window.dataLayer);
        // After "dataLayer.push", immediately clean the Value except “event”, “page type”
        window.dataLayer.push({
            'event_category': undefined,
            'event_action': undefined,
            'event_label': undefined
        });
        
    }, 20000);



    //6. 캠페인 페이지 스크롤 #62575 -2023.09.26.
    var enableEvent = {"p25Call" :"N", "p50Call" :"N", "p75Call" :"N", "p100Call" :"N" };
    var scrollEvent = function(){
        var _scrollY = window.scrollY <= $("#header").height() ? 0 : window.scrollY - $("#header").height() ;
        var scrollYPositionPercent = Math.floor((_scrollY /(document.body.clientHeight - window.innerHeight - $("#header").height() - $("#footer").height())) * 100);

        if( scrollYPositionPercent > 0 && scrollYPositionPercent%25 == 0 ){
            if( enableEvent['p'+scrollYPositionPercent+'Call'] == "N" ){
                //console.log( scrollYPositionPercent + '% Event Call!' );
                window.dataLayer.push({
                    'event': 'campaign',
                    'event_category': 'campaign page sections',
                    'event_action': 'scroll',
                    'event_label': scrollYPositionPercent + "%", // eg. '25%', '50%', '75%', '100%'
                    'page_type': 'ev day'
                });

                console.log('6. 캠페인 페이지 스크롤');
                console.log(window.dataLayer);

                // After "dataLayer.push", immediately clean the Value except “event”, “page type”
                window.dataLayer.push({
                    'event_category': undefined,
                    'event_action': undefined,
                    'event_label': undefined
                });

                enableEvent['p'+scrollYPositionPercent+'Call'] = "Y" 
            }
        }
    }
    //이벤트 리스너는 window에 걸고 scroll의 변화를 기준으로 실행합니다. 
    window.addEventListener("scroll",scrollEvent);
});
